import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './Components/header/header.component';
import { ListSkillsComponent } from './Pages/list-skills/list-skills.component';
import { SkillsComponent } from './Pages/skills/skills.component';
import { ExperienceComponent } from './Pages/experience/experience.component';
import { HomeComponent } from './Pages/home/home.component';
import { NotFoundComponent } from './Pages/not-found/not-found.component';
import { FooterComponent } from './Components/footer/footer.component';
import { ResumeComponent } from './Pages/resume/resume.component';
import { SkillService } from './services/skill.service';
import { HttpClientModule } from '@angular/common/http';
import { SkillCardComponent } from './Components/skill-card/skill-card.component';
import { ProjectManagementComponent } from './Pages/project-management/project-management.component';
@NgModule({
  // Ajout des composants
  declarations: [
    AppComponent,
    HeaderComponent,
    ListSkillsComponent,
    SkillsComponent,
    ExperienceComponent,
    HomeComponent,
    NotFoundComponent,
    FooterComponent,
    ResumeComponent,
    SkillCardComponent,
    ProjectManagementComponent,
  ],
  // Inserer toutes les bibliotheques installées
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule
  ],
  // Intégration des services qui vont faire appel à l'API
  providers: [SkillService],
  bootstrap: [AppComponent]
})
export class AppModule { }
